const Card = (props) => (

    <div className="card">
        <h5 className="card-header">Featured</h5>
        <div className="card-body">
            <h5 className="card-title">{props.title}</h5>
            <p className="card-text">{props.description}</p>
            <a href="#" class="btn btn-primary">Go Somewhere</a>
        </div>
    </div>
);

export default Card;
